import { Footer as AntdFooter } from "antd/lib/layout/layout";
import React from "react";
import "./Footer.css";

const Footer = () => {
  return (
    <AntdFooter className="footer">
      <img src="icon-white.png" alt="QKart"></img>
    </AntdFooter>
  );
};

export default Footer;
